'''{{lj|東方幻想界_-紅魔郷の音-}}'''是由[[狐之工作室]]制作并发行的东方同人专辑，该专辑首次发行于2008年5月25日第五回博麗神社例大祭上，场贩售价为1000日元，通贩售价为1365日元
==介绍==
作为狐之工作室的第一部专辑，同时也是狐之工作室《东方幻想界》系列主题专辑的首作，为狐工系列专辑的曲风奠定了基础。尽管是狐工系列的处女作，但本作优美的曲风非常受欢迎，本作的《红楼》以及《{{lj|亡き王女に捧げるセプテット}}》均是非常经典的同人曲目，即使是现在依然有一些同人作品选择本专辑中的曲目作为配乐
